import React from 'react';
import "./contact.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPhoneAlt } from '@fortawesome/free-solid-svg-icons';

const ContactUsPage = () => {
    return (
        <div className="container">
            <div className="contact-us">
                {/* Background image */}
                <img src="images/night.jpg" alt="Contact Us Background" className="contact-us-background" />
                {/* Overlay to create semi-transparent effect */}
                <div className="overlay"></div>

                {/* Contact information */}
                <div className="contact-us-content">
                    <h1 className="bold-dark">Contact Us</h1>
                    <p className="bold-dark">If you have any questions or inquiries, feel free to reach out to us:</p>
                    <ul>
                        <li className="bold-dark">Email: info@hrmvisas.com</li>
                        <li className="bold-dark">Phone: +91 97430-04400 <FontAwesomeIcon icon={faPhoneAlt} className="phone-icon" /></li> {/* Font Awesome phone icon */}
                        <li className="bold-dark">Address: 123 Main Street, City, Country</li>
                    </ul>
                    <p className="bold-dark">Alternatively, you can use the form below to send us a message:</p>
                </div>

                {/* Form */}
                <div className="form-content">
                    <form className="fade-in-form">
                        <div className="mb-3">
                            <label htmlFor="name" className="form-label">Name:</label>
                            <input type="text" id="name" name="name" className="form-control bold-white" />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="email" className="form-label">Email:</label>
                            <input type="email" id="email" name="email" className="form-control bold-white" />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="message" className="form-label">Message:</label>
                            <textarea id="message" name="message" rows="5" className="form-control bold-white"></textarea>
                        </div>
                        <button type="submit" className="btn btn-primary">Submit</button>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default ContactUsPage;
